    return (
        <div id="wrapper">
            <div>
                Header
            </div>
            <div id="actions">
                {
                props.actions ? 
                    props.actions.map((action, index) => (
                    <div key={index}>{action}</div>
                    )):''
                }
            </div>

        <style jsx>{`
            #wrapper {
                display: flex;
                width: 100%;
                padding: 10px 0 10px 0;
            }

            #actions {
                display: flex;
                margin-left: auto;
                align-items: center;
            }
        `}</style>
        </div>
    )
}

export default Header
